import React, { Component } from 'react';
import './style.css';

class Navbar extends Component {
    render() {
        return (
            <nav className="fixed-top navbar navbar-expand-lg navbar-light">
                <div class="container">
                    <a className="navbar-brand logo" href="">
                        <img src={require('../../icon/twitter.png')} alt="" />
                    </a>
                    <div class="collapse navbar-collapse">
                        <ul class="navbar-nav">

                            <li class="nav-item isearch">
                                <a href="#">
                                <i class="fab fa-twitter"> </i>
                                </a>
                                <input className="rounded-pill search" type="text" placeholder="Search Twitter" />

                            </li>
                            <li class="nav-item mr-2">
                                <button className=" tombol btn btn-outline-primary rounded-pill mr-1 btn-sm">Masuk</button>
                            </li>
                            <li class="nav-item">
                                <button className="tombol btn btn-primary rounded-pill btn-sm">Daftar</button>
                            </li>

                        </ul>
                    </div>

                </div>
            </nav>
        );
    }
}

export default Navbar;
